import React, { useState, useEffect } from 'react';
import {
    Container,
    Typography,
    CircularProgress,
    Box,
    Card,
    CardContent,
    TextField,
    Button,
    IconButton,
    Alert,
    List,
    ListItem,
    ListItemText,
    Popper,
    Paper,
    ClickAwayListener,
    LinearProgress,
} from '@mui/material';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import Brightness4Icon from '@mui/icons-material/Brightness4';
import Brightness7Icon from '@mui/icons-material/Brightness7';

function Homepage() {
    const [locations, setLocations] = useState([]);
    const [searchQuery, setSearchQuery] = useState('');
    const [filteredLocations, setFilteredLocations] = useState([]);
    const [predictions, setPredictions] = useState([]);
    const [loading, setLoading] = useState(false);
    const [darkMode, setDarkMode] = useState(false);
    const [anchorEl, setAnchorEl] = useState(null);

    // Toggle Dark Mode
    const toggleDarkMode = () => setDarkMode(!darkMode);

    // Detect User's Location
    const detectLocation = () => {
        if (navigator.geolocation) {
            navigator.geolocation.getCurrentPosition(
                (position) => {
                    const lat = position.coords.latitude;
                    const lon = position.coords.longitude;
                    fetchUserLocationPrediction(lat, lon);
                },
                (error) => alert("Location access denied.")
            );
        } else {
            alert("Geolocation is not supported by your browser.");
        }
    };

    const fetchUserLocationPrediction = (lat, lon) => {
        setLoading(true);
        fetch(`http://127.0.0.1:8000/predict/location?lat=${lat}&lon=${lon}`)
            .then(response => response.json())
            .then(data => {
                setPredictions(data);
                setLoading(false);
            })
            .catch(error => {
                console.error("Error fetching location prediction:", error);
                setLoading(false);
            });
    };

    return (
        <Container
            maxWidth="md"
            style={{
                padding: "20px",
                backgroundColor: darkMode ? "#121212" : "white",
                color: darkMode ? "#ffffff" : "#000000",
                transition: "background-color 0.3s ease, color 0.3s ease",
            }}
        >
            <Box display="flex" justifyContent="space-between" alignItems="center">
                <Typography variant="h4" fontWeight="bold">
                    Weather Prediction
                </Typography>
                <IconButton onClick={toggleDarkMode} color="inherit">
                    {darkMode ? <Brightness7Icon /> : <Brightness4Icon />}
                </IconButton>
            </Box>

            <TextField
                fullWidth
                label="Search Location"
                variant="outlined"
                value={searchQuery}
                onChange={(e) => setSearchQuery(e.target.value)}
                style={{ marginBottom: "20px", marginTop: "10px" }}
                onClick={(e) => setAnchorEl(e.currentTarget)}
            />
            <Button variant="contained" onClick={detectLocation} startIcon={<LocationOnIcon />} style={{ marginBottom: "20px" }}>
                Detect My Location
            </Button>

            {/* Show weather prediction cards */}
            <Box display="flex" flexWrap="wrap" justifyContent="space-around">
                {predictions.map((pred, index) => (
                    <Card key={index} variant="outlined" style={{ width: "30%", margin: "10px" }}>
                        <CardContent>
                            <Typography variant="h6" align="center">
                                {pred.location}
                            </Typography>
                            <Typography
                                variant="body2"
                                align="center"
                                style={{
                                    color: pred.temperature > 30 ? "red" : pred.temperature > 20 ? "orange" : "blue",
                                }}
                            >
                                Temperature: {pred.temperature}°C
                            </Typography>
                            <Box display="flex" alignItems="center" mt={1}>
                                <Typography variant="body2">Humidity:</Typography>
                                <LinearProgress
                                    variant="determinate"
                                    value={pred.humidity}
                                    style={{ width: "100%", marginLeft: "10px" }}
                                />
                            </Box>
                            <Box display="flex" alignItems="center" mt={1}>
                                <Typography variant="body2">Wind Speed:</Typography>
                                <LinearProgress
                                    variant="determinate"
                                    value={pred.windSpeed}
                                    style={{ width: "100%", marginLeft: "10px" }}
                                />
                            </Box>
                        </CardContent>
                    </Card>
                ))}
            </Box>
        </Container>
    );
}

export default Homepage;
